import { MDBBtn, MDBCol, MDBContainer, MDBRow, MDBBreadcrumb, MDBBreadcrumbItem } from "mdbreact";
import Login from './pages/Login/Login'
import "./index.css";

class App extends Component {
  render() {
    return (
        <Login/>
    );
  }
}

export default App;
